    in Colorado.  The transactions for $2,545.34 to Paul and Partners for mail costs/postage
    and $320.80 pulled from the advance to Club for Growth for mail costs (both in
    support of Bob Schaffer) were incorrectly reported as occurring on 8/10/08 due
    to a typo. The actual date of those transactions should have been 8/11/08 which
    have been properly recorded on this Monthly Report."
